var bank1Code = "0049";
var bank2Code = "2038";

var bank1Name = "Banco Santander";
var bank2Name = "Bankia";
var deployGas = 6712390;
var transGas = 600000;


var deployTransferClient = function(code, name, regulatorContract, demo, owner, callBack) {
	transferClientContract.new(code, 0, name, 2, "€", regulatorContract, demo, {
		from: owner,
		data: '',
		gas: deployGas
	}, function (e, contract) {
		console.log(e, contract);
		if (typeof contract.address !== 'undefined') {
			console.log('TransferClient contract mined! address: "' + contract.address + '"\n');
			callBack(contract);
		} else {
			console.log('Waiting for TransferClient\n');
			waitBlock(contract.transactionHash, function(){callBack(contract);})
		}
	});
}

var deployTransferManager = function(callBack) {
	transferManagerContract.new("Regulator", 0, 4, {
		from: regulator,
		data: '',
		gas: deployGas
	}, function (e, contract) {
		console.log(e, contract);
		if (typeof contract.address !== 'undefined') {
			console.log('TransferManager contract mined! address: "' + contract.address + '"\n');
			callBack(contract);
		} else {
			console.log('Waiting for TransferManager\n');
			waitBlock(contract.transactionHash, function(){callBack(contract);})
		}
	});
}

