function waitBlock(transhash, callback) {
  function innerWaitBlock() {
    var receipt = web3.eth.getTransactionReceipt(transhash);
    if (receipt && receipt.contractAddress) {
	  callback();
    } else {
      console.log("Waiting a mined block to include your contract... currently in block " + web3.eth.blockNumber);
      setTimeout(innerWaitBlock, 2000);
    }
  }
}

console.log('Calling contract creation');
deployTransferManager(function(transferManager){
	console.log('TransferManager ready, calling TransferClient');
	deployTransferClient(bank1Code, bank1Name, transferManager.address, true, bank1, function(transferClient1) {
		console.log('TransferClient ready, calling TransferClient');
		deployTransferClient(bank2Code, bank2Name, transferManager.address, true, bank2, function(transferClient2) {
			console.log('TransferClient ready, calling config');
			addBanksAccountTransfers(transferManager, transferClient1, transferClient2);
		});
	});
});

